@davestimpert yes, that looks like a bug because ParameterInfo is initialized with delimiter null. Unfortunately the groovy implemention ignores annotation as well, so there is no 'pretty' way to workaround it. You could do the following if you insist to use typed parameters in your step definition:

```
@XStreamConverter(StringListConverter)
class StringList {
    List words;
}

class StringListConverter extends Transformer<StringList> {
    def StringList transform(String string) {
        String[] tokens = string.tokenize(\\\s?\)
        return new StringList(words: Arrays.asList(tokens))
    }
}

Given(~/test (.+)/) {StringList list ->
    list.words.forEach({
        System.out.println(it)
    })
}
```

On the other hand, it might be more convenient to just split/tokenize the parameter. Sorry for the long post...

