I see this and think:

```js
serializeData: function() {
    return _.extend({}, this.model.toJSON(), {
        'has_cost': this.model.get('cost') > 0
    })
}
```

and think that `renderData` makes more sense

```js
renderData: function() {
	var data = {};

	if (_.isFunction(this.beforeRenderData)) {
		data = this.beforeRenderData(data);
	}

	var data = this.serializeData();

	if (_.isFunction(this.afterRenderData)) {
		data = this.afterRenderData(data);
	}

	return data;
}
```

Disclaimer: `renderData` is probably a bad name.

